import React, { useState, useEffect } from 'react';
import useAuth from '../../hooks/useAuth';
import { DASHBOARD_STATS } from '../../utils/constants';
import { useNavigate } from 'react-router-dom';
import './MemberDashboard.css';

const MemberDashboard = () => {
  const { currentUser } = useAuth();
  const navigate = useNavigate();
  const [stats, setStats] = useState(DASHBOARD_STATS.member);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // In a real app, this would fetch data from an API
    setLoading(true);
    setTimeout(() => {
      setStats(DASHBOARD_STATS.member);
      setLoading(false);
    }, 1000);
  }, []);

  const handleMakePayment = () => {
    navigate('/member/expenses');
  };

  const handleViewPaymentHistory = () => {
    navigate('/member/expenses');
  };

  const handleViewNotifications = () => {
    navigate('/member/notifications');
  };

  return (
    <div className="member-dashboard">
      <div className="dashboard-header">
        <h1>Dashboard</h1>
        <h2>Red Valley Apartment</h2>
        <div className="user-badge">Member</div>
      </div>
      
      <div className="welcome-section">
        <h3>Welcome back, John Doe!</h3>
        <p>Flat B - 12 - Stay updated with your payments and notifications</p>
      </div>
      
      {loading ? (
        <div className="loading-container">
          <div className="spinner"></div>
        </div>
      ) : (
        <>
          <div className="dashboard-cards">
            <div className="dashboard-card">
              <div className="card-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#6a0dad">
                  <path d="M5,6H23V18H5V6M14,9A3,3 0 0,1 17,12A3,3 0 0,1 14,15A3,3 0 0,1 11,12A3,3 0 0,1 14,9M9,8A2,2 0 0,1 7,10V14A2,2 0 0,1 9,16H19A2,2 0 0,1 21,14V10A2,2 0 0,1 19,8H9M1,10H3V20H19V22H1V10Z"/>
                </svg>
              </div>
              <div className="card-content">
                <h3>Pending Dues</h3>
                <p>₹5,000</p>
              </div>
            </div>
            
            <div className="dashboard-card">
              <div className="card-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#ff5722">
                  <path d="M19,3H14.82C14.4,1.84 13.3,1 12,1C10.7,1 9.6,1.84 9.18,3H5A2,2 0 0,0 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5A2,2 0 0,0 19,3M12,3A1,1 0 0,1 13,4A1,1 0 0,1 12,5A1,1 0 0,1 11,4A1,1 0 0,1 12,3M7,7H17V5H19V19H5V5H7V7Z"/>
                </svg>
              </div>
              <div className="card-content">
                <h3>Last Payment</h3>
                <p>2025-09-15</p>
              </div>
            </div>
            
            <div className="dashboard-card">
              <div className="card-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#4caf50">
                  <path d="M20,4H4C2.89,4 2,4.89 2,6V18A2,2 0 0,0 4,20H20A2,2 0 0,0 22,18V6C22,4.89 21.1,4 20,4M20,18H4V12H20V18M20,8H4V6H20V8Z"/>
                </svg>
              </div>
              <div className="card-content">
                <h3>Notifications</h3>
                <p>3</p>
              </div>
            </div>
            
            <div className="dashboard-card">
              <div className="card-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#4caf50">
                  <path d="M12 2C6.5 2 2 6.5 2 12S6.5 22 12 22 22 17.5 22 12 17.5 2 12 2M10 17L5 12L6.41 10.59L10 14.17L17.59 6.58L19 8L10 17Z"/>
                </svg>
              </div>
              <div className="card-content">
                <h3>My Reports</h3>
                <p>3</p>
              </div>
            </div>
          </div>
          
          <div className="quick-actions">
            <h2>Quick Actions</h2>
            <div className="action-buttons">
              <button className="action-btn" onClick={handleMakePayment}>
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                  <path d="M20,4H4C2.89,4 2,4.89 2,6V18A2,2 0 0,0 4,20H20A2,2 0 0,0 22,18V6C22,4.89 21.1,4 20,4M20,18H4V12H20V18M20,8H4V6H20V8Z"/>
                </svg>
                Make Payment
              </button>
              
              <button className="action-btn" onClick={handleViewPaymentHistory}>
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                  <path d="M13,3A9,9 0 0,0 4,12H1L4.96,16.03L9,12H6A7,7 0 0,1 13,5A7,7 0 0,1 20,12A7,7 0 0,1 13,19C11.07,19 9.32,18.21 8.06,16.94L6.64,18.36C8.27,20 10.5,21 13,21A9,9 0 0,0 22,12A9,9 0 0,0 13,3Z"/>
                </svg>
                View Payment History
              </button>
              
              <button className="action-btn" onClick={handleViewNotifications}>
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                  <path d="M21,19V20H3V19L5,17V11C5,7.9 7.03,5.17 10,4.29C10,4.19 10,4.1 10,4A2,2 0 0,1 12,2A2,2 0 0,1 14,4C14,4.1 14,4.19 14,4.29C16.97,5.17 19,7.9 19,11V17L21,19M14,21A2,2 0 0,1 12,23A2,2 0 0,1 10,21"/>
                </svg>
                View Notifications
              </button>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default MemberDashboard;
